import React from "react";
import characteristic from './characteristic.js';
import './characteristic.css';



function Characteristic (){

    return(
        <div className="characteristic">
        <h2 className="configTitle">Характеристики товара</h2>                                                      
        <ul className="characteristicColumn" key ={Characteristic.parameters} >
        {characteristic.map((item) => ( 
            <li className="characteristicRow">{item.parameter}<strong>{item.parameterValue}</strong></li>

        ))}
        </ul>                       
</div> 
    )


}

export default Characteristic
